import React from 'react';
import { Link } from 'react-router-dom';


function Header({ userEmail, isSuccess, loggedIn}) {
  return (
    <header className="header">
      <div className="header__logo" />
      <div className="header__auth">
        {isSuccess ? (
            <Link to="signin" className="header__link header__link_signup">Регистрация</Link>
          ) : (
            <Link to="signup" className="header__link header__link_login">Войти</Link>
          )
          }

        {(loggedIn) ? (
          <>
          <p className="header__user-email">{userEmail}</p>
          <Link to="signout" className="header__link header__link_logout">Выйти</Link>
          </>
          ) :(
            console.log('hey')
          )
        }
      </div>

    </header>
  );
}

export default Header;
